import React, { useEffect } from "react";
import Comp from "./Component/Comp";
import './Css/style.css';

const reducer =(state,action)=>{
    switch(action.type){
        case 'add':
            console.log('add')
        default:
            console.log('ok')
    }
}

export default function App(){
    return(
        <>
            <Comp />
        </>
    )
}
